import React from 'react';
import classes from './Order.module.css';
const order = (props) => (
    <div className={classes.Order}>
        <p> InGredients : Salad(1) Bacon(2) etc...     </p>
        <p> Price : <strong> $ 5.20</strong></p>
    </div>
);

export default order;
